import React from "react";
import SidebarMenu from 'react-bootstrap-sidebar-menu';

const Sidebar = () => {
    return (
        <div>
             <SidebarMenu>
                 <SidebarMenu.Header>
                     <SidebarMenu.Brand>

                     </SidebarMenu.Brand>
                     <SidebarMenu.Toggle />
                 </SidebarMenu.Header>
             </SidebarMenu>
        </div>
    )
}

export default Sidebar;
